cd /home/bill/.openclaw/workspace-build/bills-bot/
PR_NUM=67

# Fetch all review threads with pagination using python3 to parse
python3 <<EOF
import json
import subprocess
import sys

def run_gh_api(query):
    cmd = ["gh", "api", "graphql", "-f", f"query={query}"]
    result = subprocess.run(cmd, capture_output=True, text=True)
    if result.returncode != 0:
        print(f"Error: {result.stderr}", file=sys.stderr)
        return None
    return json.loads(result.stdout)

pr_num = $PR_NUM
cursor = None
all_unresolved = []

while True:
    cursor_str = f',after:"{cursor}"' if cursor else ""
    query = """
    {
      repository(owner: "BillChirico", name: "bills-bot") {
        pullRequest(number: %d) {
          reviewThreads(first: 100%s) {
            pageInfo {
              hasNextPage
              endCursor
            }
            nodes {
              id
              isResolved
              comments(first: 1) {
                nodes {
                  path
                  line
                  body
                }
              }
            }
          }
        }
      }
    }
    """ % (pr_num, cursor_str)

    data = run_gh_api(query)
    if not data:
        break

    threads = data['data']['repository']['pullRequest']['reviewThreads']
    for node in threads['nodes']:
        if not node['isResolved']:
            comment = node['comments']['nodes'][0] if node['comments']['nodes'] else {}
            all_unresolved.append({
                "id": node['id'],
                "path": comment.get('path', 'unknown'),
                "line": comment.get('line', 'unknown'),
                "body": comment.get('body', 'no body')
            })

    if threads['pageInfo']['hasNextPage']:
        cursor = threads['pageInfo']['endCursor']
    else:
        break

print(json.dumps(all_unresolved))
EOF

